import React, { Component } from "react";
class HiChames extends Component {
  render() {
    return (  <div style={{width :'100%' , margin:'auto'}} >
      <Grid  className = 'Landing-Grid' >
        <Cell col={12}></Cell>
      </Grid>
    </div>  )
  }
}

export default HiChames;
